import React, { UseEffect, useState } from "react";
import axios from "axios";
export default function showCatogery() {
  var [user] = useState("n");
  UseEffect(() => {
    console.log("Call Category API.");
  });
  axios
    .post("http://localhost:8080/show-Categories")
    .then((result) => {
      console.log(result.data);
    })
    .catch((error) => {
      console.log(error);
    });

  return <div>showCatogery</div>;
}
